import React, {useEffect, useState} from 'react';
import styled from './Header.module.css';
import {Link, useHistory} from "react-router-dom";

export const Header = () => {

    return (
        <div>
            <span
                className={styled.header}
            >Movies App</span>
            <ul className="navbar-nav">
                <li className="nav-item">
                    <Link
                        className="nav-link"
                        to="/"
                        exaxt>
                        Home
                    </Link>
                </li>
                <li className="nav-item">
                    <Link
                        className="nav-link"
                        to="/about">About
                    </Link>
                </li>
            </ul>
        </div>
    );
};
